import React, { useState, useEffect } from 'react';
import ApiService from '../../services/api';

const TenantDashboard = ({ property, currentUser, accessToken }) => {
    const [dashboardData, setDashboardData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        fetchDashboardData();
    }, [accessToken]);

    const fetchDashboardData = async () => {
        try {
            const data = await ApiService.portalTenantDashboard(accessToken);
            setDashboardData(data);
            setError('');
        } catch (error) {
            console.error('Dashboard fetch error:', error);
            setError(error.message || 'Failed to load dashboard data');
        } finally {
            setLoading(false);
        }
    };

    const formatDate = (dateString) => {
        return new Date(dateString).toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'long',
            day: 'numeric',
            hour: '2-digit',
            minute: '2-digit'
        });
    };

    const getInquiryStatusBadge = (status) => {
        const statusColors = {
            'pending': 'bg-yellow-100 text-yellow-800',
            'responded': 'bg-blue-100 text-blue-800',
            'resolved': 'bg-green-100 text-green-800',
            'closed': 'bg-gray-100 text-gray-800'
        };
        
        return statusColors[status?.toLowerCase()] || 'bg-gray-100 text-gray-800';
    };

    if (loading) {
        return (
            <div className="flex items-center justify-center py-12">
                <div className="text-center">
                    <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
                    <p className="text-gray-600">Loading your dashboard...</p>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="bg-red-50 border border-red-200 rounded-lg p-6">
                <div className="flex items-center">
                    <div className="text-red-400 mr-3 text-xl">‚ö†Ô∏è</div>
                    <div>
                        <h3 className="text-red-800 font-semibold">Error Loading Dashboard</h3>
                        <p className="text-red-600 text-sm mt-1">{error}</p>
                    </div>
                </div>
                <button
                    onClick={fetchDashboardData}
                    className="mt-4 px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 transition-colors"
                >
                    Try Again
                </button>
            </div>
        );
    }

    const stats = dashboardData?.dashboard_stats || {};
    const inquiries = dashboardData?.inquiries || [];

    return (
        <div className="space-y-6">
            {/* Welcome Section */}
            <div className="bg-gradient-to-r from-blue-600 to-blue-700 rounded-xl text-white p-6">
                <h2 className="text-2xl font-bold mb-2">
                    Welcome to Your Tenant Dashboard, {currentUser.first_name}!
                </h2>
                <p className="opacity-90">
                    Manage your inquiries and stay connected with <strong>{property.title}</strong>
                </p>
            </div>

            {/* Stats Cards */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                <div className="bg-white rounded-xl shadow-lg p-6">
                    <div className="flex items-center">
                        <div className="w-12 h-12 bg-blue-100 rounded-lg flex items-center justify-center mr-4">
                            <span className="text-2xl">üìù</span>
                        </div>
                        <div>
                            <div className="text-2xl font-bold text-gray-900">
                                {stats.total_inquiries || 0}
                            </div>
                            <div className="text-sm text-gray-600">Total Inquiries</div>
                        </div>
                    </div>
                </div>

                <div className="bg-white rounded-xl shadow-lg p-6">
                    <div className="flex items-center">
                        <div className="w-12 h-12 bg-yellow-100 rounded-lg flex items-center justify-center mr-4">
                            <span className="text-2xl">‚è≥</span>
                        </div>
                        <div>
                            <div className="text-2xl font-bold text-gray-900">
                                {stats.pending_inquiries || 0}
                            </div>
                            <div className="text-sm text-gray-600">Pending Response</div>
                        </div>
                    </div>
                </div>

                <div className="bg-white rounded-xl shadow-lg p-6">
                    <div className="flex items-center">
                        <div className="w-12 h-12 bg-green-100 rounded-lg flex items-center justify-center mr-4">
                            <span className="text-2xl">‚úÖ</span>
                        </div>
                        <div>
                            <div className="text-2xl font-bold text-gray-900">
                                {stats.responded_inquiries || 0}
                            </div>
                            <div className="text-sm text-gray-600">Responded</div>
                        </div>
                    </div>
                </div>
            </div>

            {/* Property Information */}
            <div className="bg-white rounded-xl shadow-lg p-6">
                <h3 className="text-xl font-bold text-gray-900 mb-4">Property Information</h3>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                    <div className="space-y-3">
                        <div className="flex justify-between">
                            <span className="text-gray-600">Property:</span>
                            <span className="font-medium">{property.title}</span>
                        </div>
                        <div className="flex justify-between">
                            <span className="text-gray-600">Location:</span>
                            <span className="font-medium">{property.city}</span>
                        </div>
                        <div className="flex justify-between">
                            <span className="text-gray-600">Monthly Rent:</span>
                            <span className="font-medium">‚Ç±{Number(property.monthly_rent).toLocaleString()}</span>
                        </div>
                    </div>
                    <div className="space-y-3">
                        <div className="flex justify-between">
                            <span className="text-gray-600">Bedrooms:</span>
                            <span className="font-medium">{property.bedrooms || 'N/A'}</span>
                        </div>
                        <div className="flex justify-between">
                            <span className="text-gray-600">Bathrooms:</span>
                            <span className="font-medium">{property.bathrooms || 'N/A'}</span>
                        </div>
                        <div className="flex justify-between">
                            <span className="text-gray-600">Floor Area:</span>
                            <span className="font-medium">{property.floor_area || 'N/A'}m¬≤</span>
                        </div>
                    </div>
                </div>
            </div>

            {/* Inquiries History */}
            <div className="bg-white rounded-xl shadow-lg p-6">
                <div className="flex items-center justify-between mb-6">
                    <h3 className="text-xl font-bold text-gray-900">Your Inquiries</h3>
                    <button
                        onClick={fetchDashboardData}
                        className="px-4 py-2 text-sm bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
                    >
                        Refresh
                    </button>
                </div>

                {inquiries.length === 0 ? (
                    <div className="text-center py-8">
                        <div className="text-4xl mb-4">üìù</div>
                        <h4 className="text-lg font-semibold text-gray-900 mb-2">No Inquiries Yet</h4>
                        <p className="text-gray-600">
                            You haven't submitted any inquiries for this property yet.
                        </p>
                    </div>
                ) : (
                    <div className="space-y-4">
                        {inquiries.map((inquiry, index) => (
                            <div key={inquiry.id || index} className="border border-gray-200 rounded-lg p-4">
                                <div className="flex items-start justify-between mb-3">
                                    <div>
                                        <h4 className="font-semibold text-gray-900">
                                            {inquiry.subject || 'General Inquiry'}
                                        </h4>
                                        <p className="text-sm text-gray-500">
                                            Submitted on {formatDate(inquiry.created_at)}
                                        </p>
                                    </div>
                                    <span className={`px-3 py-1 rounded-full text-xs font-medium ${getInquiryStatusBadge(inquiry.status)}`}>
                                        {inquiry.status?.toUpperCase() || 'PENDING'}
                                    </span>
                                </div>
                                
                                <div className="mb-3">
                                    <p className="text-gray-700">{inquiry.message}</p>
                                </div>

                                {inquiry.preferred_viewing_date && (
                                    <div className="text-sm text-gray-600 mb-2">
                                        <strong>Preferred Viewing:</strong> {formatDate(inquiry.preferred_viewing_date)}
                                    </div>
                                )}

                                {inquiry.response && (
                                    <div className="mt-3 p-3 bg-blue-50 rounded-lg">
                                        <div className="flex items-center mb-2">
                                            <span className="text-blue-600 font-semibold text-sm">Property Manager Response:</span>
                                        </div>
                                        <p className="text-blue-800 text-sm">{inquiry.response}</p>
                                        {inquiry.responded_at && (
                                            <p className="text-xs text-blue-600 mt-2">
                                                Responded on {formatDate(inquiry.responded_at)}
                                            </p>
                                        )}
                                    </div>
                                )}
                            </div>
                        ))}
                    </div>
                )}
            </div>

            {/* Quick Actions */}
            <div className="bg-white rounded-xl shadow-lg p-6">
                <h3 className="text-xl font-bold text-gray-900 mb-4">Quick Actions</h3>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                    <button className="p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-blue-500 hover:bg-blue-50 transition-colors">
                        <div className="text-2xl mb-2">üìß</div>
                        <div className="font-semibold text-gray-900">Submit New Inquiry</div>
                        <div className="text-sm text-gray-600">Ask questions about the property</div>
                    </button>
                    
                    <button className="p-4 border-2 border-dashed border-gray-300 rounded-lg hover:border-green-500 hover:bg-green-50 transition-colors">
                        <div className="text-2xl mb-2">üìÖ</div>
                        <div className="font-semibold text-gray-900">Schedule Viewing</div>
                        <div className="text-sm text-gray-600">Request a property tour</div>
                    </button>
                </div>
            </div>
        </div>
    );
};

export default TenantDashboard;
